House Oversight Committee Chairman James Comer takes questions from media regarding potential contempt proceedings against Hillary Clinton, the 2016 Democratic presidential nominee. The Committee will begin contempt proceedings if Clinton does not appear before the panel on January 14 for testimony related to the Jeffrey Epstein investigation. Bill and Hillary Clinton refused to testify, calling the Republican-led probe a &quot;partisan exercise.&quot;

